import { useState } from 'react'
import useFetch from '../hooks/useFetch'

function GetUsers(){

    const [userList, setUserList] = useState()
    const users =  useFetch('http://127.0.0.1:3000/service/users') 
        return (

            <div >
                {users?.map(u => 
                <p key={u.id}>{u.username}</p>
            )}
            </div>   
        )
 }

 export default GetUsers
